l bardo de los dos... \nCuantas capitales, y sigo sin poder encontrarte \nSuelto en Buenos Aires, en el bardo de los dos... \nPuede ser que yo esté distinto \nQue después de un tinto y un atardecer \nQuiera que, que te quedes conmigo \nY apagar el frío \nUna y otra vez \nSuelo ser un disfraz abandonado en la esquina \nY vos mi felicidad, esa que nunca termina \nCuantas terminales, y sigo sin poder encontrarte \nSuelto en Buenos Aires, en el bar donde los dos... \nCuantas capitales, y sigo sin poder encontrarte \nSuelto en Buenos Aires, en el bardo de los dos... \nCuantas terminales, y sigo sin poder encontrarte \nSuelto en Buenos Aires, en el bardo de los dos... \nCuantas capitales, ¡y sigo sin poder encontrarme! \nPreso en Buenos Aires, en el bar donde los dos... (volvimos)\n\nMusic video by Cruzando El Charco performing Terminales. (C) 2017 Pirca Records\n\nhttp://vevo.ly/UW0Bp0"},"lengthSeconds":"197","ownerProfileUrl":"http://www.youtube.com/@CruzandoElCharcoVEVO","externalChannelId":"UCxMx9GaPmjdzKlrbXa_m_-g","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY  conmigo \nY apagar el frío \nUna y otra vez \nSuelo ser un disfraz abandonado en la esquina \nY vos mi felicidad, esa que nunca termina \nCuantas terminales, y sigo sin poder encontrarte \nSuelto en Buenos Aires, en el bar donde los dos... \nCuantas capitales, y sigo sin poder encontrarte \nSuelto en Buenos Aires, en el bardo de los dos... \nCuantas terminales, y sigo sin poder encontrarte \nSuelto en Buenos Aires, en el bardo de los dos... \nCuantas capitales, ¡y sigo sin poder encontrarme! \nPreso en Buenos Aires, en el bar donde los dos... (volvimos)\n\nMusic video by Cruzando El Charco performing Terminales. (C) 2017 Pirca Records\n\nhttp://vevo.ly/UW0Bp0","commandRuns":[{"startIndex":178,"length":29,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBgQ040EGAYiEwjZxKmvzeeMAxV6UEgAHWrLL3lI3t6s5N6hhMbYAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa1d4WWlMR212Q3BJMVVXVUd6aE1OenlkMF95Z3xBQ3Jtc0tuTGlHdnJPYlVoazdOd3NlUnN1WjJKRjE5ZEd3c05tRnFNOTlyVE1pWVVMVVk0SEdfZGc0RDk1bWIxT3phTXh2VmN3ai1NOVpOeVVBZ1VzWUJLZHlLT2xXWVd2Wjl4WHVwLTNEQ2V0TFp3T0JaSGRsYw\u0026q=https%3A%2F%2Fwww.facebook.com%2Fcruzandoelcharcooficial\u0026v=2IwRDeyLL14","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa1d4WWlMR212Q3BJMVVXVUd6aE1OenlkMF95Z3xBQ3Jtc0tuTGlHdnJPYlVoazdOd3NlUnN1WjJKRjE5ZEd3c05tRnFNOTlyVE1pWVVMVVk0SEdfZGc0RDk1bWIxT3phTXh2VmN3ai1NOVpOeVVBZ1VzWUJLZHlLT2xXWVd2Wjl4WHVwLTNEQ2V0TFp3T0JaSGRsYw\u0026q=https%3A%2F%2Fwww.facebook.com%2Fcruzandoelcharcooficial\u0026v=2IwRDeyLL14","target":"TARGET_NEW_WINDOW","nofollow":true}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"Facebook Channel Link: cruzandoelcharcooficial"}}},{"startIndex":208,"length":21,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBgQ040EGAYiEwjZxKmvzeeMAxV6UEgAHWrLL3lI3t6s5N6hhMbYAQ==","commandMetadata":{"we
